(6, '{\"en\":\"Terms And Conditions\"}', '{\"en\":\"Our Terms and Conditions\"}', '{\"en\":\"Overview\\r\\nThis document is an electronic record in terms of Information Technology Act, 2000 and rules thereunder as applicable and the amended provisions pertaining to electronic records in various statutes as amended by the Information Technology Act, 2000. \\r\\nPlease read these terms and conditions carefully. \\r\\n1.\\tGeneral\\r\\nThe Chef is a service platform that links users with home-kitchens and aids in marketing and procuring hygienic, fresh, delicious and nostalgic home cooked food.  The Buyers can choose and place orders (\\u201cOrders\\u201d) from a variety of Products listed and offered for sale and The Chef enables delivery of such Orders at select localities.Our shopping apps for android and IOS devices and our website are hereinafter collectively referred to as the \\u201cPlatform\\u201d.\\r\\nThe entire Platform is operated and owned by Avaron Solutions Pvt.Ltd, Building No. V\\/246, Kaloorkulam P.O, AkalakunnamKottayam, 686503.The domain name http:\\/\\/tnmos.com\\/demo\\/the-chef\\/index.php is owned by \\u201cAvaron Solutions Pvt. Ltd\\u201d.\\r\\nBy accessing this Platform, you agree to be bound by these Terms and Conditions and acknowledge that it constitutes an agreement between you and The Chef. You agree to be bound by the terms described herein and all terms incorporated by reference. If you do not agree to these terms, kindly refrain from using services provided by the platform.\\r\\nBy using our platform, you confirm that you have read, understood and accepted these Terms and Conditions. The terms \\u2018buyer(s)\\u2019, visitor(s)\\u2019, \\u2018user(s)\\u2019, \\u2018you\\u2019 hereunder refer to the person visiting, accessing, browsing through and\\/or using the Platform at any point in time.\\r\\nThe terms \\u201cwe\\u201d, \\u201cus\\u201d, \\u201cour\\u201d, and \\u201cThe Chef\\u201d are references to the Company; \\r\\nThe term \\u201cGoods\\u201d is a reference to any goods which we may offer for sale from our platform from time to time; \\r\\n\\u201cVendors\\u201d, \\u201cKitchens\\u201dare third parties, who has registered with The Chef to prepare and\\/or deliver the Goods or Services.\\r\\nServices on the Platform are available to only available in select localities, and are subject to restrictions as set out in these terms and conditions and on our platform from time to time.\\r\\nThis document is published in accordance with the provisions of Rule 3 of the Information Technology (Intermediaries Guidelines) Rules, 2011. \\r\\nIf you have any clarifications regarding these Terms and conditions, please do not hesitate to contact us atinfo@thechef-app.com.\\r\\n2.\\tAmendments:\\r\\nThese Terms and Conditions may be updated by The Chef from time to time without any personal notice. It is recommended that you review the Terms and Conditions, as available on our Platforms each time you access and\\/or use the Platforms. \\r\\nYour continued use of our platform after the publication of the updated \\u2018Terms and Conditions\\u2019 shall constitute your consent to the updated Terms and Conditions.\\r\\n3.\\tEligibility\\r\\nPersons who are \\\"incompetent to contract\\\" within the meaning of the Indian Contract Act, 1872 including un-discharged insolvents etc. are not eligible to use the platform. \\r\\nTo be eligible for using the platform, you should be competent to enter into a contract i.e. you should have attained the age of majority according to the Indian law. This Platform is not targeted towards, nor intended for use by anyone who has not attained the age of majority. Any person under the age of 18, may only use the Platform only under the strict supervision of a parent or legal guardian who agrees to be bound by these Terms and Conditions. If your age is below 18 years, your parents or legal guardians can transact on behalf of you. \\r\\n\\r\\n4.\\tSpecific Terms of Use of our Services\\r\\na.\\tAll the Products listed on the Platform will be sold at the listed price unless specified in your order cart upon updating your precise location. These prices are subject to change with\\/without notification to you. You agree to pay for the price which is applicable and levied at the date of delivery.\\r\\nb.\\tThe Chef does not make any representation or warranty as to the item-specifics (such as legal title, creditworthiness, identity, etc.) of any of the Kitchens. You are advised to independently verify the bona fides of any particular Vendors of whose products that you choose to deal with on the Platform and use your best judgment on that behalf.\\r\\nc.\\tProducts sold on the platform are usually highly perishable and meant for immediate consumption or in accordance with the instructions or specifications of the Kitchens made available on the package, if any. We recommend that you consume the same accordingly as any complaints regarding the quality, deficiency of a particular product will be addressed by the Kitchens, subject to your compliance with the instructions or specifications of the kitchens. \\r\\nd.\\tCertain products need to be stored in the refrigerator at a particular temperature level. We recommend that you store the same accordingly as any complaints regarding the quality, deficiency of a particular product will be addressed by the Kitchens considering the adherence of storage guidelines by you.\\r\\ne.\\tThe product images displayed on platform are only for your reference. While every reasonable effort is made to maintain accuracy of information on the platform, actual product packaging, product size, weight, price and such other product details may contain more and\\/or different information than what is shown on the platform.\\r\\nf.\\tThe Chef neither makes any representation or guarantee or warranty as to specifics (such as quality, value, saleability, etc.) of the products or services proposed to be sold or offered to be sold or purchased on the Platform nor does implicitly or explicitly support or endorse the sale or purchase of any products or services on the Platform. The Chef accepts no liability for any errors or omissions, on behalf of Kitchens.\\r\\ng.\\tThe Chef is only a retailer that provides the \\u2018Platform\\u2019 to facilitate and connect the buyers and the Kitchens. In case of complaints from the Buyer pertaining to efficacy, quality, or any other such issues, users can notify the same to The Chef and concerned Kitchens shall be liable for redressing Buyer complaints. In the event you raise any, we shall assist you to the best of our abilities by providing relevant information to you, such as details of theKitchens and the specific Order to which the complaint relates, to help you in satisfactory resolution of the complaint.\\r\\nh.\\tBy using our platform and upon entering the requisite details, you agree to subscribe to newsletters, marketing or promotional materials and other information we may send. However, you may opt out of receiving any, or all, of these communications from us by following the unsubscribe link or instructions provided in any email we send.\\r\\ni.\\tEstimated time of delivery quoted at the time of ordering is approximate and may vary from day to day. The kitchen and the Platform will make every effort to deliver within the time stated, however, we will not be liable for any loss caused to you owing late delivery. If the services are not delivered within the estimated delivery time quoted by the kitchen, please contact the kitchen. You may also contact us by telephone or email in order to resolve any issues. In case of a late delivery, the delivery charge will neither be voided nor refunded by The Chef. All risk in the Goods, Services and the Service Delivery shall pass to you upon completion. \\r\\nj.\\tIn cases where You, choose to pick up the Goods on your own from the kitchen\\u2019s location after ordering \\/ purchasing the Goods, any communication with regards to Goods pick-up, directions to kitchen\\u2019s location, pick-up time will be directly between you and the kitchen. If you fail to pick-up Goods at the time they are ready for delivery or at the nominated time under any circumstances, then all risk and responsibility in relation to such goods shall pass to you. Any storage, insurance and other costs which we incur as a result of this shall be your responsibility and you shall indemnify us in full for such cost. Kitchens, who prepare your order, aim to deliver the product to you at the time of service delivery requested by you in your order; to inform you if they expect that they are unable to meet the estimated service delivery time. Any damage to the goods\\/product owing to such delay on your part shall solely be your responsibility.\\r\\n5.\\tLicense & Site access:\\r\\nThe Chef grants you a limited sub-license to access and make personal use of this site and not to download (other than page caching) or modify it, or any portion of it. This license does not include any resale or commercial use of this site or its contents; any collection and use of any product listings, descriptions, or prices; any derivative use of this site or its contents; any downloading or copying of account information for the benefit of another merchant; or any use of data mining, robots, or similar data gathering and extraction tools. \\r\\nYou shall not reproduce, duplicate, copy, sell, or exploit the platform or any part of it including but not limited to any of its offerings and the same shall not be exploited for any commercial purpose. Any unauthorized use terminates these Terms and Conditions or license granted.\\r\\nYou shall not frame or utilize framing techniques to enclose any trademark, copyright, logo, or other proprietary information (including images, text, page layout, or form) of the Platform or of The Chef without the express prior written consent of the Chef. You shall not use any meta tags or any other \\u201chidden text\\u201d utilizing the company\\u2019s name or trademarks. You shall not attempt to gain unauthorized access to any portion or feature of the Platform, or any other systems or networks connected to the Platform or to any server, computer, network, or to any of the services offered on or through the Platform, by hacking, \\u2018password mining\\u2019 or any other illegitimate means.\\r\\n\\r\\n6.\\tKitchen\\u2019s Content\\r\\nThe Platform allowskitchens\\/kitchens to post, link, store, share and otherwise make available certain information, text, graphics, videos, or other material (\\\"Content\\\"). Kitchens are responsible for the Content that posted by them on or through the Service, including its legality, reliability, and appropriateness. All materials that posted by kitchens on our Platform will be referred to collectively as \\\"Kitchen\\u2019s Content.\\\"\\r\\nBy posting Content on our Platform, the Kitchens represent and warrant that: \\r\\n(i)\\tthe Content is owned by the kitchen concerned and\\/or that the said vendors have the right to use it and the right to grant us the rights and license as provided in these Terms and Conditions, and \\r\\n(ii)\\tthat the posting of kitchen\\u2019s Content on our Platform does not violate the privacy rights, publicity rights, copyrights, contract rights or any other rights of any other person or entity. We reserve the right to terminate the account of anyone found to be infringing on a copyright.Kitchens agree to pay all royalties, fees, and any other monies owed to any person by reason of the Kitchens Content. \\r\\n(iii)\\tThe Kitchens accept full responsibility for infringement of the intellectual property or personal rights of others in connection with their Content. Kitchens are responsible for ensuring that their Content does not violate any applicable laws or rules\\/regulations. No liability whatsoever can be attributed to The Chef for any violation\\/breach of law\\/contract, due to the content posted on our platform by such kitchens.\\r\\n7.\\tOwnership of Kitchen\\u2019s Content. \\r\\nThe Chef acknowledges and agrees that kitchens retain the ownership of any and all copyrights in the kitchen\\u2019s Content, subject to the non-exclusive rights granted to The Chef, and that no ownership of such copyrights is transferred to The Chef under these Terms and Conditions. The Chef further covenants to employ reasonable efforts to appropriately attribute\\/credit the concerned kitchens for the Photos posted onto our platform by them. \\r\\n8.\\tRegulation and Removal of Kitchen\\u2019s Content. \\r\\nThe Chef reserves the right to remove all\\/any of the Kitchen\\u2019s Content, for any reason we may deem fit without notice to the kitchens concerned. We do not guarantee that we will publish all of the Kitchen\\u2019s Content. In addition, Content found on our platform is the property of The Chef or used with requisite permission from the owners. You may not distribute, modify, transmit, reuse, download, repost, copy, or use said content, whether in whole or in part, for commercial purposes or for personal gain, without express advance written permission from us.\\r\\n9.\\tPricing\\r\\nThe prices mentioned at the time of ordering will be the prices charged at the time of the delivery. Although prices of some of the products do not fluctuate on a daily basis but some of the commodities and fresh food prices do change on a daily basis. The Chef charges aDelivery fee over and above the listed price for doorstep delivery of the products available on the Platform. \\r\\n10.\\tDisclaimers and Limits of Liability \\r\\nThe Chef reserves the right to increase or decrease the said fee without notice to you. The Chef makes no representations, warranties or conditions of any kind, express or implied, with respect to the products sold on the Platform, including, but not limited to, any implied warranty of merchantability, fitness for a particular purpose, title, or non-infringement, or any warranty arising by usage of trade, course of dealing or course of performance.\\r\\n11.\\tConstruction and Severability\\r\\nThese Terms and Conditions and supersede and merge all prior proposals and all or any other prior arrangement\\/agreements. To the extent of any conflict or inconsistency between the Terms and Conditions and any pages referenced in these Terms and Conditions, the terms of these Terms and Conditions will first prevail, followed by the pages referenced in these Terms and Conditions.\\r\\nHeadings herein are for convenience of reference only and shall in no way affect interpretation of these Terms and Conditions. In the event that any provision of these Terms and Conditions shall be determined to be illegal or unenforceable, that provision will be eliminated to the minimum extent necessary so that these Terms and Conditions shall otherwise remain in full force, effect and shall be enforceable.\\r\\n12.\\tThird Party Websites\\r\\nThePlatform may contain links to third party websites\\/apps that are not owned or controlled by The Chef. The Companyassumes no responsibility for the content, privacy policies, or practices of any third party web sites or services. We do not warrant the offerings of any of these entities\\/individuals or their websites.\\r\\nYou acknowledge and agree thatThe Chef shall not be responsible or liable, directly or indirectly, for any damage or loss caused or alleged to be caused by or in connection with use of or reliance on any such content, goods or services available on or through any such third party web sites or services.We strongly advise you to read the terms and conditions and privacy policies of any third party web sites or services that you visit.\\r\\n13.\\tCopyright & Trademark\\r\\nThe Chef, its suppliers and licensors expressly reserve all intellectual property rights in all text, programs, products, processes, technology, content and other materials, which appear or are displayed on the Platform. \\r\\nMere access to the Platform or any of the services offered by The Chef shall not be construed as conferring upon anyone, any Intellectual Property owned by The Chef or any third party. Copyrights of the Platform are wholly and exclusively owned by The Chef. You may not copy, store, modify, distribute, store any data available on the website other than for your personal non-commercial use.\\r\\nThe contents and software on this website may be used only as a shopping resource. Any other use, including the reproduction, modification, distribution, transmission, republication, display, or performance, of the contents on this website is strictly prohibited.\\r\\nReviews, feedback, submissions all reviews, comments, feedback, postcards, suggestions, ideas, and other submissions disclosed, submitted or offered in connection with your use of this Platform (collectively, the \\\"Comments\\\") shall be and remain the property of The Chef. Such disclosure, submission or offer of any comments shall constitute an assignment to The Chef of all worldwide rights, titles and interests in all copyrights and other intellectual properties in the comments. Thus, The Chef owns exclusively all such rights, titles and interests and shall not be limited in any way in its use, commercial or otherwise, of any comments.\\r\\n14.\\tDisclaimer Clauses. \\r\\n\\r\\nThe Content provided herein is for informational purposes. Any changes, amendment and corrections to any part of the Content on these Services at any time without prior notice shall be within the sole discretion of The Chef.  \\r\\n\\r\\nThe Chef does not guarantee the quality of the food, the prices listed or the availability of all menu items delivered from any home kitchens. The Chef has provided all the guidelines to the home kitchen to provide good quality food and regarding complying with all statutory licenses and certificated. The Chef disclaims and all liability that may arise due to any violation of any applicable laws including the law applicable to products and services offered by the kitchen or merchant. Any dispute with regard to such non compliance should be taken directly with the home kitchen and the Chef shall assist the customers regarding the same. \\r\\n\\r\\nThe Chef does not make any warranties about the validity, authenticity, reliability and accuracy of such Certification or any information displayed by the kitchens. Any reliance by a Customer upon the Certification or information thereto shall be strictly at such Customer\'s own risk and The chef in no manner shall assume any liability whatsoever for any losses or damages in connection with the use of this information or for any inaccuracy, invalidity or discrepancy in the Certification or non-compliance of any applicable local laws or regulations by the Kitchen.\\r\\n\\r\\nThe Chef  make no guarantees, representations or warranties whatsoever, whether expressed or implied, with respect to professional qualifications, expertise, quality of work or other information herein by the Kitchen or merchant. In no event shall the Chef be liable to the Customer or any third party for any decision made or action taken in reliance on such information.\\r\\n\\r\\nThe Chef reserves the right to charge a subscription and\\/or membership and\\/or a convenience fee from a Customer or to introduce any incentive or discount programs, by giving reasonable prior notice, in respect of any product, service or any other aspect of the Chef\\u2019s Platform anytime in future. Furthermore, The Chef reserves the right to modify, cancel and discontinue its Program without notice to the Customer.\\r\\n\\r\\n15.\\tCancellation and Refund Policy\\r\\nA.\\tCustomer Cancellation\\r\\ni.\\tYou shall not be entitled to cancel an Order once it is placed. However, The Chef allows you to cancel any order within one-minute of the Order being placed. However, subject to your previous cancellation history, The Chef reserves the right to deny any refund to you pursuant to a cancellation initiated by Buyer even if the same is within one-minute followed by suspension of account, as may be necessary in the sole discretion of The Chef. \\r\\nii.\\tIf you cancel your Order after the elapse of one minute after placing it,The Chef shall have the right to collect a penalty of entireorder amount for breach of contract terms as a compensation for the damages suffered by The Chef and our partners. The Chef reserves the right either not to refund the Order value in case your Order is prepaid or recover the amount from you on subsequent Order in case your Order is post-paid, in order to compensate our Kitchen and Delivery partners.\\r\\n\\r\\n\\r\\nB.\\tNon-Customer Cancellation\\r\\nThe Chef reserves the right to collect a penalty for the Orders constrained to be cancelled by us for reasons not attributable to us, including but not limited to the following:\\r\\ni.\\tin the event if the address provided by you is either wrong or falls outside the delivery zone;\\r\\nii.\\tfailure to contact you by phone or email at the time of delivery of your Order booking;\\r\\niii.\\tfailure to deliver your Order due to lack of information, direction or authorization from you at the time of delivery; or\\r\\niv.\\tunavailability of all the items ordered by you at the time of booking the Order; or\\r\\nv.\\tunavailability of all the items ordered by you at the time of booking the Order. However, in the unlikely event of an item in an Order being unavailable, we will will contact you on the phone number provided to us at the time of placing the Order and inform you of such unavailability. In such an event youshall be entitled to cancel the entire Order and shall be entitled to a refund to an amount upto 100% of the Order value.\\r\\n2.\\tIn case of cancellations for the reasons attributable to The Chefs or our kitchen or delivery partners, The Chefs shall not collect any penalty from you.\\r\\nC.\\tRefund Policy\\r\\n1.\\tYou may be entitled to a refund for certain prepaid Orders.  The Chefs reserve the right to retain the penalty payable by youas provided above from the amount refundable to you. As provided above, You shall also be entitled to a refund of proportionate value in the event packaging of an item in an Order or the complete Order, is either tampered or damaged and you refuse to accept such package at the time of delivery for the said reason;\\r\\n2.\\tYou may also be entitled to a refund of upto 100% of the Order value if our delivery partner fails to deliver the Order due to a cause attributable to either such delivery partner or The Chefs, however such refunds will be assessed on a case to case basis by The Chefs.\\r\\n3.\\tOur decision on refunds shall be final and binding.\\r\\n4.\\tAll refund amounts shall be credited to your account in the same mode the payment is made while ordering on our Platform, the estimated timelines are set out herein below. However, the timelines provided under may vary on a case to case basis.\\r\\nCircumstances eligible for Refund\\tPayment Mode\\tEstimated Timeline\\r\\nCancellation\\/Compensation\\/Payment Failure\\/ Order Edit\\r\\n\\tNet Banking\\t5-7 Business Days\\r\\n\\tDebit\\/Credit Cards\\t4-7 Business Days\\r\\n\\tUPI\\t2-4 Business Days\\r\\n5.\\tIn case of paymenton deliveryis chosen as the preferred mode of payment, you will not be required to pay for:\\r\\n1.\\tOrders where packaging is either tampered or damaged at the time of delivery;\\r\\n2.\\tWrong Order being delivered; or\\r\\n3.\\tItems missing from Buyer\\u2019s Order at the time of delivery.\\r\\nProvided the same is communicated immediately to our Customer Care through the contact details provided on our Platform.\\r\\n16.\\tDisclaimers and Limits of Liability\\r\\nThe Chef makes no representations, warranties or conditions of any kind, express or implied, with respect to the products sold on the Platform, including, but not limited to, any implied warranty of merchantability, fitness for a particular purpose, title, or non-infringement, or any warranty arising by usage of trade, course of dealing or course of performance. \\r\\nIn no event shall The Chef, nor its directors, employees, partners, agents, suppliers, or affiliates, be liable for any indirect, incidental, special, consequential or punitive damages, including without limitation, loss of profits, data, use, goodwill, or other intangible losses, resulting from (i) your access to or use of or inability to access or use our Platform; (ii) any conduct or content of any third party on our Platform; (iii) any content obtained from our Platform; and (iv) unauthorized access, use or alteration of your transmissions or content, whether based on warranty, contract, tort (including negligence) or any other legal theory, whether or not we have been informed of the possibility of such damage, and even if a remedy set forth herein is found to have failed of its essential purpose.\\r\\nIn the event that The Chef is found liable to you for whatsoever reason, you shall only be entitled to recover actual and direct damages and such damages shall not exceed the actual value of the transaction in which you have suffered the alleged loss. \\r\\nThe Chef shall not in any way be liable for any incidental, indirect or consequential damages (including without limitation loss of profit, revenue or use) arising out of or in any way connected with Terms and Conditions, whether in contract, warranty, tort (including negligence, whether active, passive or imputed), product liability, strict liability or other theory. \\r\\nIn no event shall The Chef, nor its directors, employees, partners, agents, suppliers, or affiliates, be liable for any indirect, incidental, special, consequential or punitive damages, including without limitation, loss of profits, data, use, goodwill, or other intangible losses, resulting from (i) your access to or use of or inability to access or use our Platform; (ii) any conduct or content of any third party on our Platform; (iii) any content obtained from our Platform; and (iv) unauthorized access, use or alteration of your transmissions or content, whether based on warranty, contract, tort (including negligence) or any other legal theory, whether or not we have been informed of the possibility of such damage, and even if a remedy set forth herein is found to have failed of its essential purpose.\\r\\nIn the event that The Chef is found liable to you for whatsoever reason, you shall only be entitled to recover actual and direct damages and such damages shall not exceed the actual value of the transaction in which you have suffered the alleged loss. \\r\\nThe Chef shall not in any way be liable for any incidental, indirect or consequential damages (including without limitation loss of profit, revenue or use) arising out of or in any way connected with Terms and Conditions, whether in contract, warranty, tort (including negligence, whether active, passive or imputed), product liability, strict liability or other theory. \\r\\n17.\\tTermination\\r\\nWe may terminate or suspend your account and bar access to the Service immediately, without prior notice or liability, under our sole discretion, for any reason whatsoever and without limitation, including but not limited to a breach of these Terms and Conditions.\\r\\nIf you wish to terminate your account, you may simply discontinue using our Platform.\\r\\nAll provisions of the Terms which by their nature should survive termination shall survive termination, including, without limitation, ownership provisions, warranty disclaimers, indemnity and limitations of liability.\\r\\n18.\\tGoverning Law and Jurisdiction:\\r\\nThese Terms and Conditions shall be construed in accordance with the applicable laws of India.The parties hereto submit to the exclusive jurisdiction of the courts of India.\\r\\nNo delay or failure on our part to enforce our rights or remedies under the Agreement shall constitute a waiver on our part of such rights or remedies unless such waiver is confirmed in writing.\"}', 1, 1, 1, '2020-09-08 06:13:58', '2021-04-12 00:15:11'),
(7, '{\"en\":\"About app\"}', '{\"en\":\"About us\"}', '{\"en\":\"\\\" The Chef \\\"app is a platform consisting of a small group of youngsters who have sensed this feeling and have brought into existence an app that can fetch you such nostalgic homemade food at your doorstep with just a touch of your fingertip on our prestigious app. Anyone can get your name registered in our app and cook from home, upload the food menus in our app and the notification on the same will be sent to everyone who has subscribed to our app. The Chef app will be the medium of supplying ordered food from each kitchen.\\r\\n\\r\\nIt is not to be forgotten that cooks and chefs around the world seem to be mostly men, and so, all the more reason to give them a space to explore and exhibit their magical touch in cooking good authentic food and deliver it to customers through\\\" The Chef \\\"app. Anyone for that matter, who has a flair or passion for cooking can try their luck, get paid for their masterpieces, and thus earn an income.\\r\\n\\r\\nWomen, commonly the so-called \\u201chomemakers\\u201d are seldom given a voice of appreciation by their families, even after all the pain, that they endure in preparing food for all at home and occasionally for guests too. The case in villages is even tougher. Homemakers are the only ones in the society who never get any remuneration for their sincerity and hard work but instead are conveniently forgotten by all, even after consuming a minimum of three meals a day, made by them.\\r\\n\\r\\n\\r\\nHere \\\"The Chef\\\" app comes like an angel to these amazing homemakers in helping them convert themselves into vendors. \\\"The Chef\\\"app helps them sell out their valuable cooked food and enables them to earn an income, thus, in turn, appreciating their food. Thus, \\\"The Chef\\\" app promotes women\'s empowerment too. Children turning out to be Little Chefs are quite common these days. \\\"The Chef \\\" app acknowledges these little hands at work too. It helps children with a passion for cooking to prove their ability as Little Chefs and sell out their food through this platform and earn an income accordingly. \\\"The Chef\\\" app helps any random person who has a vehicle of his or her own (or could rent one) and is willing to work as a delivery person. \\\"The Chef\\\" app helps the unemployed by allowing them to work as a part-time delivery person irrespective of their age and earn an income of their own.\"}', 1, 3, 1, '2021-04-13 04:24:34', '2021-04-26 23:22:44'),
(8, '{\"en\":\"Join with us\"}', '{\"en\":\"Join with us\"}', '{\"en\":\"Join with us\"}', 1, 2, 1, '2021-04-16 02:59:31', '2021-04-16 03:02:03');
